import React from "react";
import "./App.css";


const Navigation = ({onRouteChange,isSignedIn}) => {
    if (isSignedIn !== true) {
        return (
            <ul className="navbar">
                <li>sports</li>
                <li>about me</li>
                <li onClick={() => onRouteChange('signin')} className="push">sign in</li>
                <li onClick={() => onRouteChange('register')}>register</li>
            </ul>

        );
    }
    else{
            return (
                <ul className="navbar">
                    <li>sports</li>
                    <li>about me</li>
                    <li onClick={() => onRouteChange('signin')} className="push">sign out</li>
                </ul>
            );
        }
}
export default Navigation;
